import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

function About() {
  const skills = [
    { name: "Nuke", level: "Advanced" },
    { name: "After Effects", level: "Advanced" },
    { name: "TouchDesigner", level: "Intermediate" },
    { name: "DaVinci Resolve", level: "Advanced" },
    { name: "Python", level: "Intermediate" },
    { name: "Motion Design", level: "Advanced" }
  ];

  const experience = [
    {
      title: "Compositor & Technical Director",
      company: "Incognito Studio",
      period: "2021 - Present",
      description: "Leading VFX compositing team and developing pipeline solutions for animated features."
    },
    {
      title: "Compositor",
      company: "PFX Studio",
      period: "2024",
      description: "Contributed to feature film projects focusing on advanced compositing techniques."
    }
  ];

  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
      className="max-w-4xl mx-auto px-4 py-24"
    >
      {/* Bio Section */}
      <section className="mb-16">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.2 }}
        >
          <h1 className="text-4xl font-bold mb-8">About Me</h1>
          <div className="prose prose-invert prose-lg max-w-none">
            <p className="text-gray-300 leading-relaxed">
              Martin Tomek is a Prague-based VFX artist and technical director specializing in glitch art, 
              visual effects, and real-time visuals. With a background in advanced compositing and pipeline 
              development, Martin blends technical precision with artistic experimentation.
            </p>
            <p className="text-gray-300 leading-relaxed">
              His glitch art collections leverage analog techniques, digital tools, and procedural designs, 
              bringing a distinct, raw aesthetic to each piece. Martin's work goes beyond visual boundaries, 
              using creative coding and computer vision to merge physical and digital realms.
            </p>
          </div>
        </motion.div>
      </section>

      {/* Skills Section */}
      <section className="mb-16">
        <h2 className="text-2xl font-bold mb-6">Technical Expertise</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          {skills.map((skill, index) => (
            <motion.div
              key={skill.name}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: index * 0.1 }}
              className="bg-white/5 p-4 rounded-lg"
            >
              <h3 className="font-medium mb-2">{skill.name}</h3>
              <div className="h-2 bg-white/10 rounded-full">
                <div 
                  className="h-full bg-purple-500 rounded-full"
                  style={{ 
                    width: skill.level === "Advanced" ? "90%" : 
                           skill.level === "Intermediate" ? "70%" : "50%" 
                  }}
                />
              </div>
            </motion.div>
          ))}
        </div>
      </section>

      {/* Experience Section */}
      <section className="mb-16">
        <h2 className="text-2xl font-bold mb-6">Experience</h2>
        <div className="space-y-6">
          {experience.map((job, index) => (
            <motion.div
              key={job.title}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.2 }}
              className="bg-white/5 p-6 rounded-lg"
            >
              <h3 className="text-xl font-bold mb-2">{job.title}</h3>
              <div className="flex items-center gap-2 text-purple-400 mb-3">
                <span>{job.company}</span>
                <span>â€¢</span>
                <span>{job.period}</span>
              </div>
              <p className="text-gray-300">{job.description}</p>
            </motion.div>
          ))}
        </div>
      </section>

      {/* Contact Section */}
      <section>
        <h2 className="text-2xl font-bold mb-6">Get in Touch</h2>
        <div className="bg-white/5 p-6 rounded-lg">
          <p className="text-gray-300 mb-6">
            Interested in collaboration or have a project in mind? Feel free to reach out.
          </p>
          <div className="flex flex-wrap gap-4">
            <Link
              to="/contact"
              className="px-6 py-3 bg-purple-600 text-white rounded-full font-medium 
                       hover:bg-purple-700 transition-colors"
            >
              Contact Me
            </Link>
            <a
              href="/resume.pdf"
              className="px-6 py-3 border border-white/10 rounded-full 
                       hover:bg-white/5 transition-colors"
              target="_blank"
              rel="noopener noreferrer"
            >
              Download Resume
            </a>
          </div>
        </div>
      </section>
    </motion.div>
  );
}

export default About;
